import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { Header } from './components/Header/Header';

import { HomePage } from './pages/HomePage/HomePage';
import { AdminPage } from './pages/AdminPage/AdminPage';
import { PostPage } from './pages/PostPage/PostPage';

const routes = [
  {
    path: '/',
    exact: true,
    component: () => <HomePage />
  },
  {
    path: '/home',
    exact: true,
    component: () => <HomePage />
  },
  {
    path: '/admin',
    exact: true,
    component: AdminPage
  },
  {
    path: '/Post',
    exact: true,
    component: PostPage
  },
];

const App = () => {
  return (
      <Router>
        <Header />
        <Switch>
          {routes.map(route => {
            return (
              <Route
                key={route.path}
                path={route.path}
                exact={route.exact}
                component={route.component()}
              />
            );
          })}
        </Switch>
      </Router>
  );
};

export default App;
